import React from 'react';
import './App.scss';
import logo from './logo.svg'
import Table from './components/Table';
import FetchBrewery from './components/FetchBrewery';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";


class App extends React.Component {


  render () {

    return (
      <div className="App">
      <HashRouter>
        <nav className="navbar navbar-light bg-light">
        <a className="navbar-brand" href="./"> 
          <img src={logo} alt="logo" width="40" /> Breweries 
        </a>
        </nav>

        <nav className="navbar navbar-light bg-light">
        <input type="text" className="input" placeholder="Search City ..." onChange={this.searchByCity} />
        </nav>
        {/* {<Table breweries={ this.state.breweries } /> } */}

        <Route path="/Table" component={Table}/>
      </HashRouter>
    </div>
    )
  };
}



export default App;
